import { Breadcrumb } from "flowbite-react";
import { BeakerIcon } from '@heroicons/react/24/solid'
export default function(){
    return (
        <Breadcrumb aria-label="Default breadcrumb example">
            <Breadcrumb.Item
                href="#"
                icon={BeakerIcon}
            >
                Home
            </Breadcrumb.Item>
            <Breadcrumb.Item href="#">
                Projects
            </Breadcrumb.Item>
            <Breadcrumb.Item>
                Flowbite React
            </Breadcrumb.Item>
        </Breadcrumb>
    )
}
